import React, {useState, useEffect} from "react";
import {
    MobileNav,
    IconButton,
} from "@material-tailwind/react";
import {Link} from "react-router-dom";
interface Props {
    loggedIn: boolean;
}
//https://www.material-tailwind.com/docs/react/navbar
export default function Header({loggedIn}: Props) {
    const [openNav, setOpenNav] = useState(false);

    useEffect(() => {
        window.addEventListener(
            "resize",
            () => window.innerWidth >= 960 && setOpenNav(false)
        );
    }, []);

    const navList = (
        <ul className="mb-4 mt-2 flex flex-col gap-2" style={{height: openNav ? undefined : 0}}>
            <Link to={"/dashboard"} style={{pointerEvents: openNav ? undefined : "none"}}>
                <li className="nav-item">
                    <a className="nav-link block pr-2 lg:px-2 py-2 text-gray-600 hover:text-gray-700 focus:text-gray-700 transition duration-150 ease-in-out"
                       href="#!" data-mdb-ripple="true" data-mdb-ripple-color="light">Dashboard</a>
                </li>
            </Link>
            <Link to={"/profile"} style={{pointerEvents: openNav ? undefined : "none"}}>
            <li className="nav-item">
                <a className="nav-link block pr-2 lg:px-2 py-2 text-gray-600 hover:text-gray-700 focus:text-gray-700 transition duration-150 ease-in-out"
                   href="#!" data-mdb-ripple="true" data-mdb-ripple-color="light">Profile</a>
            </li>
            </Link>
            <Link to={"/qr"} style={{pointerEvents: openNav ? undefined : "none"}}>
                <li className="nav-item">
                    <a className="nav-link block pr-2 lg:px-2 py-2 text-gray-600 hover:text-gray-700 focus:text-gray-700 transition duration-150 ease-in-out"
                       href="#!" data-mdb-ripple="true" data-mdb-ripple-color="light">QR</a>
                </li>
            </Link>
            <Link to={"/transaction"} style={{pointerEvents: openNav ? undefined : "none"}}>
            <li className="nav-item">
                <a className="nav-link block pr-2 lg:px-2 py-2 text-gray-600 hover:text-gray-700 focus:text-gray-700 transition duration-150 ease-in-out"
                   href="#!" data-mdb-ripple="true" data-mdb-ripple-color="light">Transactions</a>
            </li>
            </Link>
            <Link to={"/loan"} style={{pointerEvents: openNav ? undefined : "none"}}>
                <li className="nav-item">
                    <a className="nav-link block pr-2 lg:px-2 py-2 text-gray-600 hover:text-gray-700 focus:text-gray-700 transition duration-150 ease-in-out"
                       href="#!" data-mdb-ripple="true" data-mdb-ripple-color="light">Loan</a>
                </li>
            </Link>
            <Link to={"/"} style={{pointerEvents: openNav ? undefined : "none"}}>
            <li className="nav-item mb-2 lg:mb-0">
                <a className="nav-link block pr-2 lg:px-2 py-2 text-gray-600 hover:text-gray-700 focus:text-gray-700 transition duration-150 ease-in-out"
                   href="#!" data-mdb-ripple="true" data-mdb-ripple-color="light">Logout</a>
            </li>
            </Link>
        </ul>
    );

    return (
        <nav
            className="navbar navbar-expand-lg shadow-md py-2 mb-2 bg-white relative flex items-center w-full justify-between">
            <div className="px-6 w-full flex flex-wrap items-center justify-between">
                <div className="container mx-auto flex items-center justify-between text-blue-gray-900">
                    {/*app icon*/}
                    <Link to={"/dashboard"}
                    >
                        <button
                            className="navbar-toggler border-0 py-3 w-20 leading-none text-xl bg-transparent text-gray-600 hover:text-gray-700 focus:text-gray-700 transition-shadow duration-150 ease-in-out mr-2"
                            type="button"
                        >
                            <img className="object-contain"
                                 src="data:image/jpg;base64,"/>
                        </button>
                    </Link>
                    <div className="hidden">{navList}</div>
                    {/*hamburger icon*/}
                    {loggedIn &&
                    <IconButton
                        variant="text"
                        className="ml-auto h-6 w-6 text-inherit hover:bg-transparent focus:bg-transparent active:bg-transparent"
                        ripple={false}
                        onClick={() => setOpenNav(!openNav)}
                    >
                        {openNav ? (
                            <svg
                                xmlns="http://www.w3.org/2000/svg"
                                fill="none"
                                className="h-6 w-6"
                                viewBox="0 0 24 24"
                                stroke="currentColor"
                                strokeWidth={2}
                            >
                                <path
                                    strokeLinecap="round"
                                    strokeLinejoin="round"
                                    d="M6 18L18 6M6 6l12 12"
                                />
                            </svg>
                        ) : (
                            <svg
                                xmlns="http://www.w3.org/2000/svg"
                                className="h-6 w-6"
                                fill="none"
                                stroke="currentColor"
                                strokeWidth={2}
                            >
                                <path
                                    strokeLinecap="round"
                                    strokeLinejoin="round"
                                    d="M4 6h16M4 12h16M4 18h16"
                                />
                            </svg>
                        )}
                    </IconButton>
                    }
                </div>
                {/*expander*/}
                <MobileNav open={openNav}>
                    {navList}
                </MobileNav>
            </div>
        </nav>
    );
}

